import React from "react";
import Slider from "react-slick";
import "./CardSlider.css"; // Crie este arquivo para o CSS

// Ícones ou nomes das tecnologias para os cards
const techStack = [
    "React",
    "JavaScript",
    "HTML",
    "CSS",
    "Git",
    "Node.js"
];


const CardSlider = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      }; 
    

    return (
        <div className="slider-container">
            <div className="fade-left"></div>
            <Slider {...settings}>
            <div>
        <h3>1</h3>
      </div>
      <div>
        <h3>2</h3>
      </div>
      <div>
        <h3>3</h3>
      </div>
      <div>
        <h3>4</h3>
      </div>
      <div>
        <h3>5</h3>
      </div>
      <div>
        <h3>6</h3>
      </div>
            </Slider>

            <div className="fade-right"></div>
        </div>
    );
};

export default CardSlider;
